import * as React from 'react';
//import { View } from 'react-native';
import { NavProfile, AccountDashboard } from '@bdevrepo/user-profile-native';
//import Dashboard from './DashboardCard';
import { createStackNavigator } from '@react-navigation/stack';
import { NavigationContainer } from '@react-navigation/native';

function Profile() {
  return (
    <NavProfile accountPage='AccountDashboard' logoutPage='Logout' />
  );
}

function AccountDash(param:any) {
  return (
    <AccountDashboard parentDash={param} />
  );
}

export default App = ()  => {
  const Stack = createStackNavigator();
  const callBackAllData = (data: any) => {
    console.log('teste', data);
  }
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="App">
        <Stack.Screen name="App" component={Profile} options={{ headerShown: false }} />
        <Stack.Screen name="Logout" component={NavProfile} options={{ headerShown: false }} />
        <Stack.Screen name="AccountDashboard" component={AccountDash(callBackAllData.bind(this))} options={{ headerShown: false }} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
